import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // To make the price filter visible, we first need to perform a search
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'electronics');
    await page.click('button.search-btn');

    // Wait for search results and filter to appear
    await page.waitForSelector('.price-filter', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_results.png'));

    // Fill in the minimum price
    const minPriceInput = await page.waitForSelector('#minPrice', { timeout: 5000 });
    await minPriceInput.fill('50');

    // Fill in the maximum price
    const maxPriceInput = await page.waitForSelector('#maxPrice', { timeout: 5000 });
    await maxPriceInput.fill('100');

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_price_range_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_price_range_filled.png'));

    // Click the apply filter button
    const applyButton = await page.waitForSelector('button.apply-filter', { timeout: 5000 });
    await applyButton.click();

    // A notification should appear confirming the action
    await page.waitForSelector('.notification.success', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_filter_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_filter_applied.png'));

    // Extract data to verify
    const minPriceValue = await page.inputValue('#minPrice');
    const maxPriceValue = await page.inputValue('#maxPrice');
    const notificationText = await page.textContent('.notification.success');

    return {
      success: true,
      action: "Applied a price range filter from 50 to 100.",
      extractedData: {
        minPrice: minPriceValue,
        maxPrice: maxPriceValue,
        confirmationMessage: notificationText
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price range filter.",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
